import './index.css';
import JordanLogo from '../../../assets/jordan.svg';

const Menu = () => {
    return (
        <div className="Menu">
             <div className="Jumpman"><img src={JordanLogo} alt="JumpMan Logo" /></div>
             <ul>
                <li>Help</li>
                <li>Join Us</li>
                <li>Sign in</li>
            </ul>
        </div>

    );
}

export default Menu;
